function dq3 = dq3(x,th,S)
h = 1e-4;
v = x;
df = (-f(v+2*h,th,S)+8*f(v+h,th,S)-8*f(v-h,th,S)+f(v-2*h,th,S)) / (12*h);
dq3 = df(23);
fprintf('dq3: %g\n',th);
end
